import axios from 'axios';
import React, { useEffect, useState } from 'react';

function Home(props) {
    const [data,setData] = useState([""])
    const fetchApi = async ()=>{

        const data =await axios.get
        ("https://youtube.googleapis.com/youtube/v3/videos?part=player&chart=mostPopular&maxWidth=200&key=AIzaSyDGfgHu5xMnVzAtjs1bYgWGYYUF6yA8dXg")
        setData(data.data.items.map(e=>e.player.embedHtml))
         console.log(data.data.items.map(e=>e.player.embedHtml))

        //  setData(data.data.items[0].player.embedHtml)
    }
    useEffect(()=>{
        fetchApi()
    },[])

    return (
        <div>
        {data.map((e)=>{e})}
        </div>
    );
}

export default Home;
